// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract Market is ReentrancyGuard {
    using Counters for Counters.Counter;
    Counters.Counter private _listingCount;
    Counters.Counter private _offerCount;
    Counters.Counter private _saleCount;

    mapping(uint256 => Listing) public marketListings;
    mapping(uint256 => Offer) public offers;

    uint256 LISTING_PRICE = 0.01 ether;

    struct Offer {
        uint256 id;
        address userAddress;
        uint256 price;
        address nftContractAdd;
        uint256 tokenId;
        bool fulfilled;
        bool cancelled;
    }

    struct Listing {
        uint256 listingId;
        address nftContractAdd;
        uint256 tokenId;
        address ownerAdd;
        uint256 price;
        bool isSold;
        bool isCancelled;
    }

    constructor() payable {
        _listingCount.increment(); // start from 1
        _offerCount.increment(); // start from 1
    }

    function putOnSale(
        address _nftContract,
        uint256 _tokenId,
        uint256 _price
    ) public payable nonReentrant {
        ERC721 nft = ERC721(_nftContract);
        address tokenOwner = nft.ownerOf(_tokenId);
        require(msg.sender == tokenOwner, "Only token owner can do this.");
        require(msg.value == LISTING_PRICE, "Listing fee must be sent");

        nft.transferFrom(msg.sender, address(this), _tokenId);

        uint256 itemId = _listingCount.current();
        _listingCount.increment();
        marketListings[itemId] = Listing(
            itemId,
            _nftContract,
            _tokenId,
            payable(msg.sender),
            _price,
            false,
            false
        );

        emit ListingCreated(itemId, msg.sender, _nftContract, _tokenId, _price);
    }

    // function cancelSale(uint256 listingId) public nonReentrant {
    //     Listing storage listing = marketListings[listingId];

    //     require(msg.sender == listing.ownerAdd, "Only owner can do this action");
    //     require(!listing.isSold, "Item has been already sold.");

    //     listing.isCancelled = true;

    //     IERC721(address(listing.nftContractAdd)).transferFrom(address(this), msg.sender, listing.tokenId);

    //     emit ListingCancelled(listing.listingId, listing.ownerAdd, listing.nftContractAdd, listing.tokenId);
    // }

    // function placeBid(address _nftContractAdd, uint256 _tokenId, uint256 _price) public {
    //     IERC721 nft = IERC721(_nftContractAdd);
    //     address tokenOwner = nft.ownerOf(_tokenId);
    //     require(msg.sender != tokenOwner, "You are owner of this token");

    //     // @dev First, set WETH allowance for this market contract using WETH contract.
    //     IERC20 weth = IERC20(address(0xc778417E063141139Fce010982780140Aa0cD5Ab));
    //     uint256 allowance = weth.allowance(msg.sender, address(this));
    //     require(allowance >= _price, "WETH allowance is not enough");

    //     uint256 currentOffer = _offerCount.current();
    //     _offerCount.increment();
    //     offers[currentOffer] = Offer(
    //         currentOffer,
    //         msg.sender,
    //         _price,
    //         _nftContractAdd,
    //         _tokenId,
    //         false,
    //         false
    //     );

    //     emit BidPlaced(currentOffer, msg.sender, _nftContractAdd, _tokenId, _price);
    // }

    // function acceptBid(uint _offerId) public nonReentrant {
    //     Offer storage offer = offers[_offerId];
    //     require(!offer.fulfilled, "Offer already fulfilled.");
    //     require(!offer.cancelled, "Offer cancelled.");

    //     IERC721 nft = IERC721(offer.nftContractAdd);
    //     address nftOwner = nft.ownerOf(offer.tokenId);

    //     /*
    //     * There are two case of accepting an offer: 1- NFT was not listed 2- NFT was already listed
    //     * If the owner address equals the address of this contract, it means NFT already listed
    //     * In this case, we need to find in our `listings` mapping and adjust the actual owner...
    //     */
    //     Listing storage listing;
    //     if(nftOwner == address(this)){
    //         listing = _getListedItem(offer.nftContractAdd, offer.tokenId);
    //         nftOwner = listing.ownerAdd;
    //     }
    //     require(msg.sender == nftOwner, "Only owner of the token can do this");

    //     /*
    //     * TODO: There might be a vulnerability: what if NFT owner removes approval for our contract? Or vice versa?
    //     * In this version, omitting this possibility...
    //     */
    //     IERC20 weth = IERC20(address(0xc778417E063141139Fce010982780140Aa0cD5Ab));
    //     weth.transferFrom(address(offer.userAddress), payable(msg.sender), offer.price);

    //     if(listing.listingId != 0){
    //         nft.transferFrom(address(this), offer.userAddress, offer.tokenId);
    //         listing.isSold = true;
    //     } else {
    //         nft.transferFrom(nftOwner, offer.userAddress, offer.tokenId);
