    function _getListedItem(address _nftContractAddress, uint256 _tokenId)
        public
        view
        returns (Listing memory item)
    {
        require(_nftContractAddress != address(0), "0 address");

        for (uint256 i = 0; i <= _listingCount.current(); i++) {
            if (
                marketListings[i].nftContractAdd == _nftContractAddress &&
                marketListings[i].tokenId == _tokenId &&
                !marketListings[i].isSold &&
                !marketListings[i].isCancelled
            ) {
                return marketListings[i];
            }
        }

        revert("Listing not found");
    }

    /**
     * Since we're not using a proxy or sth like that in this version of contract, we transfer listed items to Market contract.
     * So, listed items won't be in the wallet of user.
     * We need to get listed items of user in the application
     *
     * Maybe we can implement a proxy in the future... :O
     */
    function getListedItemsOf(address userAddress) public {}

    event ListingCreated(
        uint256 indexed listingId,
        address indexed owner,
        address indexed nftContract,
        uint256 tokenId,
        uint256 price
    );

    event ListingCancelled(
        uint256 indexed listingId,
        address indexed owner,
        address indexed nftContract,
        uint256 tokenId
    );

    event BidPlaced(
        uint256 indexed bidId,
        address indexed bidder,
        address indexed nftContractAdd,
        uint256 tokenId,
        uint256 price
    );

    event ItemSold(
        uint256 indexed saleCount,
        address indexed seller,
        address indexed buyer,
        uint256 price
    );
}
